import React from 'react'
import './Dashboard.scss'
import 'bootstrap/dist/css/bootstrap.css';

function Dashboard() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return (
    <div className='dash'>
        <h1>This is my Dashboard</h1>
    </div>
  )
}

export default Dashboard
